    public static void main(String[] args) {
        ArrayList<Integer> rleaPattern = new ArrayList<>();
        int counter = 0;
        int lastOne = 0;
        for (int r = 0; r < 100; r++){
            for (int c = 0; c < 100; c++) {
                if (pattern[c + r *100] == lastOne)
                    counter++;
                else
                    rleaPattern.add(counter);
                lastOne = pattern[c + r *100];
                counter = 1;
            }
         }
        for (int i = 0; i < 100; i++)
        {
            for (int j = 0; j < 100; j++)
            {
                if (pattern[j + i * 100] == 1)
                    System.out.print("■");
                else
                    System.out.print("□");


            }
            System.out.println();
        }

        System.out.println("Pattern length before compression " + pattern.length + " bits");

    }
